import watch from "../images/apple_watch_9.jpeg";

function Body() {
  return (
    <div className="bodyImageWrapper">
      <h2>Learn about new Apple Watch</h2>
      <button>Find out more</button>
      <img src={watch} alt="watch_logo" />
    </div>
  );
}

export default Body;
